import React from 'react';
import "./video.css";
function video() {
  return (
    <div className='video'>
        <div className='video-container'>
            <h2 className='title'>
            </h2>
            <video src='./videos/BB8.mp4' autoPlay loop muted />
            <p className='note'></p>
        </div>
    </div>
  )
}

export default video
